@tmz_tv

NFTs are the biggest new thing to hit the market - but what the heck are they?

In short, they're unique digital assets that can be bought and sold but aren't tangible like sports cards or works of art you can hang in your home...but that doesn't mean they're worth any less.

@jack was getting bids of up to $2.5M for his first Tweet

@gronk sold $1.2M worth of his trading cards with @mediumrare 

@grimes sold a 50-second video for almost $390k

There’s still a lot of moving parts when it comes to NFTs as they're in the early stages, but this is something we're going to see for a while.

What are your thoughts on the NFT trend?
